import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';

const data = [
  { name: 'Computer Vision', value: 50 },
  { name: 'NLP', value: 80 },
  { name: 'Speech Synthesis', value: 70 },
  { name: 'Art Generation', value: 60 },
  { name: 'Gaming', value: 90 }
];

const Reports = () => {
  return (
    <div>
      <h2>Reports on Generative AI Applications</h2>
      <BarChart width={600} height={300} data={data}>
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="value" fill="#82ca9d" />
      </BarChart>
      <p>This chart shows the popularity of generative AI applications across various fields.</p>
      <p>Source: <a href="https://example.com">example.com</a></p>
    </div>
  );
};

export default Reports;
